import { Image, SafeAreaView, View, Text } from 'react-native';
import { home, menu } from '../style/style.js';

export default function Sidebar() {
  return (
    <SafeAreaView>
      <Image
        style={home.sidebarIcon}
        source={require('../assets/home.svg')}
      />
      <View style={home.menu}>
      </View>
    </SafeAreaView>
    
    
  );
}
